import React, { useEffect, useState } from 'react';
import axios from 'axios';
import SingleItem from './SingleItem';


const options = {
  method: 'GET',
  url: 'https://crypto-news11.p.rapidapi.com/cryptonews/blockchain',
  params: {max_articles: '10', last_n_hours: '48', top_n_keywords: '10'},
  headers: {
    'X-RapidAPI-Key': '954299c48dmsh59046fca4571ccap1d35c8jsnb9da0c777064',
    'X-RapidAPI-Host': 'crypto-news11.p.rapidapi.com'
  }
};


function Home() {

  const [newsList, setNewsList]=useState([]);


  useEffect(()=>{


      const fetchData=async()=>{
        
           try{
            const {data}=await axios.request(options);
            setNewsList(data);
           }
           catch(error){
            console.log(error);
           }

      }

      fetchData();

  }, [])





  return (
    <div>

      {newsList.map((item)=>(<SingleItem />))}


    </div>
  )
}

export default Home
